import React, {Component} from 'react';

class Saved extends Component {   


    render (){

        return (
            <div>
            <h1 className="display-5">Saved</h1>
            {/* <p>{this.props.faves.length}</p> */}
            <p>{this.props.faves}</p>
            <div>{this.props.faves.map((arr, index) =><li key={index}>{arr}</li>)}</div>
            </div>
        );
    }
}

export default Saved;
